// "catac"
function make_palindrome(string){
  let palindrome = "";
  let start = 0;
  let end = string.length - 1;

  while (start < end) {
    if (string[start] === string[end]) {
      palindrome += string[start];
      start++;
      end--;
    } else {
      palindrome += string[start];
      start++;
      end--;
    }
  }

  return palindrome;
}
