// 3
// >>> prime_fib(3)
// 5
// >>> prime_fib(4)
// 13
// >>> prime_fib(5)
// 89
function prime_fib(n){
    if(n<=2){
        return n;
    }
    if(n%2!=0){
        return prime_fib(n/2);
    }
    return prime_fib(n/2+1);
}
