// true
// >>> is_palindrome("aaaaa")
// true
// >>> is_palindrome("zbcd")
// false
function is_palindrome(text){
    let reversed = "";
    for(let i = 0; i < text.length; i++){
        reversed += text[i];
    }
    return (reversed === text) ? true : false;
}
//Return 2^n modulo p (be aware of numerics).
// >>> modp(3, 5)
// 3
// >>> modp(1101, 101)
// 2
// >>> modp(0, 101)
// 1
// >>> modp(3, 11)
// 8
// >>> modp(100, 101)
// 1
function modp(n, p){
    if(p < 0){
        return 0;
    }
    if(p == 0){
        return 1;
    }
    if(p % 2 == 0){
        return (n % p) + modp(n, p/2);
    }
    return (n % p) % p;
}
