//Return n-th Fibonacci number.
// >>> fib(10)
// 55
// >>> fib(1)
// 1
// >>> fib(8)
// 21
function fib(n){
    let a = 0, b = 1;
    let fib_sequence = [a, b];
    while(b--){
        fib_sequence.push(a);
        a = b;
        b = a;
    }
    return fib_sequence.reverse();
}
