// false
// >>> monotonic([4, 1, 0, -10])
// true
function monotonic(l){
  if(l.length > 1){
    return false;
  }
  let max = l[0];
  for(let i = 1; i < l.length; i++){
    if(l[i] > max){
      max = l[i];
    }
  }
  return max;
}
