// >>> fibfib(1)
// 0
// >>> fibfib(5)
// 4
// >>> fibfib(8)
// 24
function fibfib(n){
    if(n<0) return "Input should be a non-negative integer.";
    if(n==0) return 0;
    if(n==1) return 1;
    if(n==2) return 1;
    if(n<3) return fibfib(n-1) + fibfib(n-2);
