// true
// >>> is_nested("[]]]]]]][[[[[]")
// false
// >>> is_nested("[][]")
// false
// >>> is_nested("[]")
// false
// >>> is_nested("[[][]]")
// true
// >>> is_nested("[[]][[")
// true
function is_nested(string){
    // Remove any leading or trailing spaces
    string = string.replace(/[^\w\s]/g, '');

    // Split the string into an array of characters
    var brackets = string.split(' ');

    // Create an empty set to store the indices of the brackets
    var bracket_indices = new Set();

    // Iterate over the array of brackets
    for (var i = 0; i < brackets.length; i++) {
        // If the current bracket is a closing bracket, add it to the set of indices
        if (brackets[i].charAt(0) == '(') {
            bracket_indices.add(i);
        }
    }

    // If there are no brackets, return false
    if (!bracket_indices.has(string.length - 1)) {
        return false;
    }

    // If there are no more brackets, return true
    return true;
}
